column1:
nmcli can accepts both direct JSON configuration data and a file name containing the configuration. In the latter case the file is read and the contents is put into this property.

Examples: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column3:
nmcli এ দুয়ো প্ৰত্যক্ষ JSON সংৰূপ তথ্য আৰু সংৰূপ অন্তৰ্ভুক্ত কৰা এটা ফাইল নাম গ্ৰহণ কৰিব পাৰে। পিছৰ ক্ষেত্ৰত ফাইল পঢ়া হয় আৰু সমলসমূহক এই বৈশিষ্ট্যত থোৱা হয়।

উদাহৰণ: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column1:
Usage: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column3:
ব্যৱহাৰ: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column1:
Usage: nmcli general status { help }

Show overall status of NetworkManager.
'status' is the default action, which means 'nmcli gen' calls 'nmcli gen status'

column3:
ব্যৱহাৰ: nmcli general status { help }

NetworkManager ৰ সৰ্বমুঠ অৱস্থা দেখুৱাওক।
'status' হল অবিকল্পি কাৰ্য্য, যাৰ অৰ্থ 'nmcli gen' এ 'nmcli gen status' ক কল কৰে

column1:
Usage: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column3:
ব্যৱহাৰ: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column1:
Usage: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of all radio switches, or turn them on/off.

column3:
ব্যৱহাৰ: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

সকলো ৰেডিঅ' চুইচৰ অৱস্থা প্ৰাপ্ত কৰক, অথবা সিহতক অন/অফ কৰক।

column1:
Usage: nmcli radio wifi { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of Wi-Fi radio switch, or turn it on/off.

column3:
ব্যৱহাৰ: nmcli radio wifi { ARGUMENTS | help }

ARGUMENTS := [on | off]

Wi-Fi ৰেডিঅ' চুইচৰ অৱস্থা প্ৰাপ্ত কৰক, অথবা ইয়াক অন/অফ কৰক।

column1:
Usage: nmcli radio wwan { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of mobile broadband radio switch, or turn it on/off.

column3:
ব্যৱহাৰ: nmcli radio wwan { ARGUMENTS | help }

ARGUMENTS := [on | off]

মবাইল ব্ৰডবেণ্ড ৰেডিঅ' চুইচৰ অৱস্থা প্ৰাপ্ত কৰক, অথবা ইয়াক অন/অফ কৰক।
